import React, { Component } from 'react';
import NavDropdown from 'react-bootstrap/';
import { getGameList } from '../../../actions/rawg-api';

export default class NavbarDropdown extends Component {
  constructor(props) {
    super(props);

    this.state = {
      list: [],
    };
  }

  async componentDidMount() {
    this.setState({
      list: await getGameList(this.props.queryCategory, this.props.queryItem),
    });
  }

  render() {
    // const galleryData = this.state.list.map((game) => <GameItem game={game} />);
    return (
      <NavDropdown
        title="Browse"
        id="collasible-nav-dropdown"
        className="mx-1"
      >
        <NavDropdown.Item as={Link} to="/action">
          Action
              </NavDropdown.Item>
        <NavDropdown.Divider />
      </NavDropdown>
    );
  }
}
